//Polymorphism in ES6 implies the ability to write one function that can accept different types of data. Polymorphic functions can be broken down into smaller, more flexible functions which accept a variety of data types. This makes code more modular and easier to maintain.

//Example
function determineColor(value) {  
  if (typeof value === 'string') {
    return `The color is ${value}`;
  } else if (typeof value === 'object') {
    const r = value.red;
    const g = value.green;
    const b = value.blue;
    return `The color is RGB(${r}, ${g}, ${b})`;
  } else {
    return 'No color';
  }
}
//Usage 
determineColor('blue'); // The color is blue 
determineColor({ red: 255, green: 0, blue: 0 }); // The color is RGB(255, 0, 0)

